['다른 드래곤들을 이용하여 드래곤의 레벨을 상승시키는 기능입니다.\n올라가는 경험치의 양은 다음과 같은 조건에 의해 달라지며,\n레벨업에 사용한 드래곤은 테이머님을 떠나갑니다.\n\n- {@YELLOW}기본 제공 경험치{@DEFAULT}: 레벨업에 사용한 드래곤의 등급과 레벨에 따라 상승합니다.\n- {@YELLOW}속성{@DEFAULT}: 레벨업 시킬 드래곤과 같은 속성의 드래곤을 사용할 경우 50%의 추가 경험치를 획득할 수 있습니다.\n- {@YELLOW}슬라임{@DEFAULT}: 게임 플레이 중 간혹 획득할 수 있는 슬라임은 매우 많은 경험치를 제공합니다.\n- {@YELLOW}추가 경험치{@DEFAULT}: 레벨업 기능 이용 시 낮은 확률로 보너스 경험치를 획득할 수 있으며, 친밀도가 높은 드래곤을 재료로 사용하면 확률이 상승합니다.']='Bu boshqa ajdaholar yordamida ajdaho darajasini oshirish funksiyasidir.\nQo‘lga kiritilgan qo‘shimcha EXP quyidagi shartlarga ko‘ra farqlanadi.\nDarajani oshirish uchun ishlatiladigan ajdarlar Tamer tark etadi. \n\n- {@YELLOW} Odatiy EXP{@DEFAULT}: darajani oshirish uchun ishlatiladigan ajdaho darajasi va darajasiga qarab oshirildi. \n- {@YELLOW} atributi{@DEFAULT}: Agar siz daraja koʻtarmoqchi boʻlgan ajdaho bilan bir xil atributga ega ajdahodan foydalansangiz, 50% koʻproq EXP olishingiz mumkin. \n- {@YELLOW} Slime{@DEFAULT}: Oʻyin davomida kamdan-kam olinadigan shilimshiqlar koʻp EXP taqdim etadi. \n- {@YELLOW} Qo\'shimcha EXP{@DEFAULT}: Darajani oshirish funksiyasidan foydalanganda siz past ehtimollik bilan bonus EXP olishingiz mumkin. Material sifatida yuqori yaqinlikdagi ajdahodan foydalansangiz, imkoniyat ortadi.',
