['드래곤 테이머즈M에는 테이머님이 보유한 드래곤의 종류와 특성에 따라 4가지 진형 중 하나를 선택하여 전투를 더 유리하게 진행할 수 있습니다.\n모든 진형은 각각 다른 효과를 가지고 있으며 진형 레벨업으로 진형의 효과를 강화시킬 수 있습니다.']='Ajdaho Tamers M-da jangni sizga qulayroq qilish uchun sizda qanday ajdarlar va ularning atributlariga qarab 4 ta tuzilishdan birini tanlashingiz mumkin.\nHar bir tuzilma turli effektlarga ega va siz Formation Level-up orqali effektlarni oshirishingiz mumkin.',
