['드래곤은 11종류의 능력치를 가지고 있으며 드래곤의 종류에 따라 시작 능력치가 다릅니다.\n공격력, 방어력, 생명력은 드래곤의 레벨업, 진화, 승급을 통해 상승시킬 수 있으며 그 외 능력치는 룬이나 스킬 등을 통해서만 상승시킬 수 있습니다.\n\n- {@RED}공격력{@DEFAULT} : 일반공격 및 스킬공격의 피해량이 증가됩니다.\n- {@pink}방어력{@DEFAULT} : 적의 공격을 받았을 때 피해량이 감소됩니다.\n- {@YELLOW}생명력{@DEFAULT} : 드래곤의 최대 생명력이 증가되어 더 오래 생존할 수 있습니다.\n- {@BLUE}공격속도{@DEFAULT} : 드래곤이 일반공격을 하는 빈도가 높아집니다.\n- {@purple}치명확률{@DEFAULT} : 드래곤이 공격을 할 때 치명타가 발생하는 확률이 증가됩니다.\n- {@pink}치명피해{@DEFAULT} : 드래곤의 공격에 치명타가 발생했을 때의 피해량이 증가됩니다.\n- {@green}치명회피{@DEFAULT} : 적에게 치명타를 받았을 때 치명타를 무효시키는 확률이 증가됩니다. 치명회피에 성공하면 치명타 피해가 아닌 일반 피해를 받게 됩니다.\n- {@YELLOW}회피{@DEFAULT} : 적의 공격을 회피하는 확률이 증가됩니다. 회피는 일반공격, 패시브 스킬, 드래그 스킬 등 모든 공격에 적용되며 회피에 성공하면 피해를 입지 않게 됩니다.\n- {@grass_green}적중{@DEFAULT} : 적에게 공격을 명중시키는 확률이 증가됩니다. 회피가 높은 적에게 유용합니다.\n- {@green}효과저항{@DEFAULT} : 적의 스킬로 해로운 효과가 발생할 때 효과를 무효시키는 확률이 증가됩니다.\n- {@RED}효과적중{@DEFAULT} : 효과저항을 가진 적의 저항 확률을 낮춥니다. 최소 15% 이하로는 효과저항을 낮추지 못합니다.']='Barcha ajdaholarda 11 turdagi statistika mavjud va standart statistika ajdaho turiga qarab farqlanadi.\nATK, DEF, HP darajasini oshirish, Evolyutsiya, Rank-yu oshirish orqali oshirish mumkin, ammo boshqa statistikani faqat Runes yoki Skills orqali oshirish mumkin. \n\n- {@RED} ATK{@DEFAULT}: Oddiy hujumlar va mahoratlarning zararini oshiring. \n- {@pink} DEF{@DEFAULT}: Hujum qilinganda kamroq zarar oling. \n- {@YELLOW} HP{@DEFAULT}: Dragonning maksimal HP darajasi oshirildi, bu esa janglarda uzoqroq turishiga imkon beradi. \n- {@BLUE} ATK tezligi{@DEFAULT}: Ajdaho tez-tez hujum qiladi. \n- {@purple} Kritik stavka{@DEFAULT}: Kritik zarbalar berish imkoniyati ortadi. \n- {@pink} Critical DG{@DEFAULT}: Ajdaho Kritik zarba berganida, zarar ortadi. \n- {@green} Critical Evasion{@DEFAULT}: Kiruvchi Kritik Xitlarni inkor etish imkoniyati ortadi. Agar ajdaho Critical Evasion bilan muvaffaqiyat qozonsa, buning o\'rniga normal zarar oladi. \n- {@YELLOW} Evasion{@DEFAULT} : Dushman hujumidan qochish imkoniyati ortadi. Evasion oddiy hujumlar, passiv ko\'nikmalar, Drag ko\'nikmalari va boshqalar kabi barcha hujumlarga qo\'llaniladi. Ajdaho hujumdan muvaffaqiyatli o\'tib ketsa, hech qanday zarar ko\'rmaydi. \n- {@grass_green} ACC{@DEFAULT}: Dushmanga zarba berish imkoniyati ortadi. Bu statistik ko\'rsatkich yuqori qochish darajasiga ega bo\'lgan dushmanga qarshi kurashda muhim ahamiyatga ega. \n- {@green} Ta\'sirga qarshilik{@DEFAULT}: Dushmanlar mahoratining zararli ta\'sirini yo\'q qilish imkoniyati. \n- {@RED} Effekt aniqligi{@DEFAULT}: Dushmanning effektga qarshi turish imkoniyatini kamaytiring. Ta\'sir qarshiligini 15% dan pastga tushirib bo\'lmaydi.',
