['드래곤의 숲을 레벨업했습니다.']='Ajdaho Forestning darajasi oshirildi.',
['드래곤의 스킬 1개가\n무작위로 레벨다운됩니다.']='Ajdaho tasodifiy mahorat bilan\n1 darajani yo\'qotadi.',
['드래곤의 스킬을 {1}번 이상 사용']='{1} dan ortiq ajdaho mahoratidan foydalaning',
['드래곤의 스킬이 잠금해제 되었습니다!']='Dragonning mahorati ochildi!',
['드래곤의 인벤토리가 가득차면 연속 전투 종료']='Dragon Inventarizatsiya toʻlganida takroriy jangni tugating',
['드래곤의 장비!']='Dragon jihozlari!',
['드래곤의 진화에 사용되는 각종 진화 재료를 얻을 수 있는 던전입니다.\n거대용들의 특성을 파악하고 속성을 공략해, 여러분의 드래곤을 진화시켜보세요.\n\n<보스 정보>\n- {@YELLOW}보석 거대용{@DEFAULT}: 보석 거대용은 생명력이 매우 높지만, 난이도 자체는 평범합니다.\n- {@grass_green}땅의 거대용{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거대용{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거대용{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거대용{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거대용{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Bu zindon boʻlib, u yerda siz evolyutsiya uchun zarur boʻlgan turli Evolyutsiya materiallarini olishingiz mumkin.\nMassiv ajdaholarning xususiyatlarini bilib oling va ajdaholaringizni rivojlantirish uchun ularning atributlaridan foydalaning. \n\n<Boss Info> \n- {@YELLOW} Massive Gem Ajdaho{@DEFAULT}: Massive Gem Ajdaho juda yuqori HPga ega, lekin uni o‘ldirish qiyin emas. \n- {@grass_green} Massive Yer Ajdaho{@DEFAULT}: Suv ajdaholariga katta zarar yetkazadi. \n- {@BLUE} Massive Suv ajdahosi{@DEFAULT}: Yong\'in Dragonsga katta zarar yetkazadi. \n- {@RED} Massive Olovli ajdaho{@DEFAULT}: Yer ajdaholariga katta zarar yetkazadi. \n- {@YELLOW} Massive Nur Ajdaho{@DEFAULT}: Qorong\'i Dragonsga katta zarar yetkazadi. \n- {@GRAY} Massive Qorong\'i Ajdaho{@DEFAULT}: Nur ajdaholarga katta zarar yetkazadi.',
['드래곤의 최대레벨이 10 증가하였습니다!']='Dragonning maksimal darajasi 10 ga oshdi!',
['드래곤의 힘을 더 강하게 할 수 있는 룬을 얻을 수 \n 있는 곳으로, 악몽 던전에서만 발견되는 룬도 있다고 합니다.']='Ajdahongizni yanada kuchliroq qilmoqchimisiz?\nAytishlaricha, ba\'zi runlarni\nfaqat Nightmare Dungeonda topish mumkin.',
['드래곤이 가득 찼습니다.\n인벤토리 공간을 확보 후 전투를 시작할 수 있습니다.']='Ajdaholar toʻlgan.\nBoʻsh joyni qoʻlga kiritsangiz, jangni boshlashingiz mumkin.',
['드래곤이 가진 스킬은 레벨이 높을 수록 스킬 능력이 강화되어 전투를 더 유리하게 진행할 수 있습니다.\n스킬의 레벨을 상승시키려면 {@YELLOW}같은 이름의 드래곤{@DEFAULT} 혹은 {@YELLOW}스킬 슬라임{@DEFAULT}이 필요하며, 최고 레벨이 아닌 보유 스킬 중 하나가 무작위로 레벨이 상승합니다.']='Ajdaholarning mahorati kuchayib boradi va uning darajasi oshgani sayin jangni sizga qulayroq qiladi.\nAjdahoning mahorat darajasini oshirish uchun sizga {@YELLOW} oʻsha ajdaho{@DEFAULT} yoki {@YELLOW} Skill Slime{@DEFAULT} kerak boʻladi. . Keyin maksimal darajaga etmagan tasodifiy mahorat darajasi oshiriladi.',
['드래곤이 가진 스킬의 종류에 따라 {@YELLOW}조건부로 발동{@DEFAULT}하는 자동 스킬입니다.\n발동 조건은 드래곤의 스킬에 따라 각각 다르며, 드래곤 관리 화면에서 확인하실 수 있습니다.']='{@YELLOW} avtomatik mahorati shartli ravishda faollashtiriladi{@DEFAULT}, bu sizning ajdahongiz qanday mahoratga ega ekanligiga qarab.\nFaollashtirish sharti ajdarlarning mahoratidan farq qiladi va uni Ajdaho boshqaruvi sahifasida tekshirish mumkin.',
['드래곤이 강한 정도를 나타내는 보조적인 정보입니다.\n전투력이 낮더라도 파티의 조합과 스킬의 활용에 따라 충분히 극복 가능합니다.']='Ajdaho qanchalik kuchli ekanligini koʻrsatadigan qoʻshimcha maʼlumotlar.\nU zaif boʻlsa-da, uni partiya tarkibi va mahoratdan foydalanish orqali engish mumkin.',
['드래곤이 얼마나 희귀한지를 나타내는 정보입니다.\n드래곤이 희귀할수록 더 강하고 좋은 스킬을 가지고 있으며, 드래곤이 희귀할수록 드래곤의 최초 등급이 더 높습니다.\n\n- 일반 희귀도: 1~2등급 상태로 획득\n- {@BLUE}희귀 희귀도{@DEFAULT}: 3등급 상태로 획득\n- {@purple}영웅 희귀도{@DEFAULT}: 4등급 상태로 획득\n- {@YELLOW}전설 희귀도{@DEFAULT}: 5등급 상태로 획득']='Bu maʼlumot ajdaho qanchalik kamdan-kam uchraydiganligini koʻrsatadi.\nKeyrakroq ajdaholar kuchliroq va yaxshiroq mahoratga, shuningdek, yuqori boshlangʻich darajaga ega. \n\n- Oddiy: 1-2-sinf sifatida oling \n- {@BLUE} Kamdan-kam{@DEFAULT}: 3-sinf sifatida oling \n- {@purple} Qahramonlik{@DEFAULT}: 4-sinf sifatida oling \n- {@YELLOW} Afsonaviy{@DEFAULT}: 5-sinf sifatida oling',
['드래곤이 없습니다.']='Inventarizatsiyada ajdarlar yo\'q.',
['드래곤이 좋아하는 열매를 얻을 수 있는 던전으로, 열매를 얻어 드래곤의 친밀도를 높일 수 있습니다.\n\n<보스 정보>\n- {@grass_green}땅의 거목{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거목{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거목{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거목{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거목{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Bu sizning ajdaholaringizga yoqadigan turli xil mevalarni olishingiz mumkin bo\'lgan zindon va bu mevalar bilan yaqinlikni oshirishingiz mumkin. \n\n<Boss Info> \n- {@grass_green} Katta Yer daraxti{@DEFAULT}: Suv ajdarlariga katta zarar yetkazing. \n- {@BLUE} Massive Suv Tree{@DEFAULT}: Yong\'in Dragonsga katta zarar yetkazing. \n- {@RED} Katta Yong\'in daraxti{@DEFAULT}: Yer ajdaholariga katta zarar yetkazing. \n- {@YELLOW} Massive Nur Tree{@DEFAULT}: Qorong\'i Dragonsga katta zarar yetkazing. \n- {@GRAY} Massive Qorong\'i Tree{@DEFAULT}: Nur ajdaholarga katta zarar yetkazing.',
['드래곤이 희귀할수록 처음 획득했을 때의 등급이 높아집니다.\n다만 낮은 등급의 드래곤도 계속 키워나가면 6등급까지 성장시킬 수 있으니, 맘에 드는 드래곤을 마지막까지 함께 하실 수 있습니다.']='Ajdaho qanchalik kam bo\'lsa, uning boshlang\'ich darajasi shunchalik yuqori bo\'ladi.\nBiroq, boshlang\'ich darajasi pastroq bo\'lgan ajdarlarni 6-sinfgacha etishtirish mumkin, shuning uchun siz o\'zingiz yoqtirgan ajdahoni oxirigacha saqlab qolishingiz mumkin.',
