['드래곤과 몬스터들은 스킬을 통해서 아군을 강하게 하는 효과를 부여할 수 있습니다.\n\n- {@green}공격력 증가{@DEFAULT} : 공격력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}방어력 증가 {@DEFAULT}: 방어력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}공격속도 증가{@DEFAULT} : 공격속도가 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}치명확률 증가{@DEFAULT} : 치명확률이 30% 증가됩니다.\n- {@green}치명회피 증가{@DEFAULT} : 치명회피가 30% 증가됩니다.\n- {@green}회피 증가{@DEFAULT} : 회피가 30% 증가됩니다.\n- {@green}적중 증가{@DEFAULT} : 적중이 30% 증가됩니다.\n- {@green}무적{@DEFAULT} : 모든 피해를 받지 않습니다. 해로운 효과에는 걸릴 수 있습니다.\n- {@green}좀비{@DEFAULT} : 생명력이 0이 될 때 발동하며 죽지 않는 상태가 됩니다. 지속시간이 끝나면 바로 사망합니다.\n스킬에 따라 공격속도 300% 증가 혹은 치명확률 50% 증가의 비약적 증가 효과를 함께 얻습니다.\n- {@green}보호막{@DEFAULT} : 보호막이 가지고 있는 생명력 만큼의 피해를 방어합니다.\n- {@green}반사{@DEFAULT} : 적으로부터 받는 피해의 80%만 받으며 나머지 20%의 피해를 공격자에게 되돌립니다.\n- {@green}면역{@DEFAULT} : 모든 해로운 효과에 걸리지 않습니다. 이미 걸린 해로운 효과는 해제되지 않습니다.\n- {@green}흡혈{@DEFAULT} : 적에게 피해를 입혔을 때 피해량의 10%를 자신의 생명력으로 회복합니다.']='Ajdaho va yirtqich hayvonlar ittifoqchilarga foydali effektlar berishi mumkin. \n\n- {@green} Hujumni oshirish{@DEFAULT}: ATK 20% ga oshdi. (3 martagacha yigʻish mumkin) \n- {@green} DEF ni oshirish {@DEFAULT}: DEF 20% ga oshiriladi. (3 martagacha yigʻish mumkin) \n- {@green} ATK tezligini oshiring {@DEFAULT}: ATK tezligi 20% ga oshdi. (3 martagacha biriktirilishi mumkin) \n- {@green} Kritik stavkani oshirish{@DEFAULT}: Kritik stavka 30% ga oshdi. \n- {@green} Kritik qochish darajasini oshirish{@DEFAULT}: Kritik qochish 30% ga oshdi. \n- {@green} Evasion darajasini oshirish{@DEFAULT}: Qochish 30% ga oshdi. \n- {@green} ACCni oshirish{@DEFAULT}: ACC 30% ga oshirildi. \n- {@green} Daxlsiz{@DEFAULT}: Barcha hujumlarga qarshi immunitetga ega, ammo zararli ta\'sirlardan ta\'sirlanadi. \n- {@green} Zombie{@DEFAULT}: HP 0 ga yetganda faollashadi. Davomiylik tugamaguncha Ajdaho o‘lmaydi.\nUshbu dramatik effektlardan birini qo‘lga kiriting: 300% ATK tezligi yoki 50% Critical ortishi. Qobiliyatga qarab baho bering. \n- {@green} Toʻsiq{@DEFAULT}: toʻsiqning HPiga teng zararga qarshilik koʻrsatadi. \n- {@green} Reflect{@DEFAULT}: Dushmandan faqat 80% zarar oling va 20% hujumchiga qaytaring. \n- {@green} Immunitet{@DEFAULT}: Barcha zararli ta\'sirlarga qarshi immunitet. Hozirgi zararli ta\'sirlar olib tashlanmaydi. \n- {@green} HP absorbsiyasi{@DEFAULT}: HP sifatida dushmanga yetkazilgan zararning 10 foizini tiklang.',
['드래곤과 몬스터들은 스킬을 통해서 적을 약하게 하는 효과를 부여할 수 있습니다.\n\n- {@YELLOW}공격력 감소{@DEFAULT} : 공격력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}방어력 감소{@DEFAULT} : 방어력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}공격속도 감소{@DEFAULT} : 공격속도가 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}치명확률 감소{@DEFAULT} : 치명확률이 30% 감소됩니다.\n- {@YELLOW}치명피해 감소{@DEFAULT} : 치명피해가 50% 감소됩니다.\n- {@YELLOW}치명회피 감소{@DEFAULT} : 치명회피가 30% 감소됩니다.\n- {@YELLOW}회피 감소{@DEFAULT} : 회피가 30% 감소됩니다.\n- {@YELLOW}적중 감소{@DEFAULT} : 적중이 30% 감소됩니다.\n- {@YELLOW}회복량 감소{@DEFAULT} : 회복을 받았을 때 회복량이 70% 감소됩니다.\n- {@YELLOW}기절{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다.\n- {@YELLOW}수면{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다. 공격을 받았을 때 해제됩니다.\n- {@YELLOW}침묵{@DEFAULT} : 모든 스킬을 사용할 수 없습니다.\n- {@YELLOW}지속피해{@DEFAULT} : 일정 시간마다 최대 생명력의 0.5%의 피해를 받습니다. (최대 3회까지 중첩 가능)']='Ajdaho va yirtqich hayvonlar dushmanlarga zararli ta\'sir ko\'rsatishi mumkin. \n\n- {@YELLOW} Hujumni kamaytirish{@DEFAULT}: Hujum 20% ga kamaydi. (3 martagacha yigʻish mumkin) \n- {@YELLOW} DEFni kamaytirish {@DEFAULT}: DEF 20% ga kamayadi. (3 martagacha yigʻish mumkin) \n- {@YELLOW} Hujum tezligini pasaytirish {@DEFAULT}: ATK tezligi 20% ga kamaydi. (3 martagacha yigʻish mumkin) \n- {@YELLOW} Kritik darajani pasaytirish{@DEFAULT}: Kritik koʻrsatkich 30% ga kamaydi. \n- {@YELLOW} Critical DG kamaytirish{@DEFAULT}: Critical DG 50% ga kamaydi. \n- {@YELLOW} Kritik qochish darajasini pasaytirish{@DEFAULT}: Kritik qochish 30% ga kamaydi. \n- {@YELLOW} Evasion pasaytirish{@DEFAULT}: qochish 30% ga kamaydi. \n- {@YELLOW} ACCni kamaytirish{@DEFAULT}: ACC 30% ga kamaydi. \n- {@YELLOW} Qayta tiklash tezligini pasaytirish{@DEFAULT}: Qayta tiklash miqdori 70% ga kamaydi. \n- {@YELLOW} Stun{@DEFAULT}: Hujum qilish yoki mahoratdan foydalanish mumkin emas. \n- {@YELLOW} Kutish{@DEFAULT}: Barcha ko\'nikmalardan foydalana olmaysiz va hujum qila olmaysiz. Hujum qilinganda holat oʻchirildi. \n- {@YELLOW} Jimlik{@DEFAULT}: Barcha ko‘nikmalarni ishlatib bo‘lmaydi. \n- {@YELLOW} NOKTA zarari{@DEFAULT}: Har bir belgilangan vaqtda maksimal HPning 0,5% zararini oling. (3 martagacha yig\'ish mumkin)',
