['룬이 가지고 있는 기본 능력이며 룬 번호에 따라 부여될 수 있는 옵션의 종류가 다릅니다.\n\n- {@YELLOW}1번{@DEFAULT} : 공격력\n- {@YELLOW}2번{@DEFAULT} : 공격력, 방어력, 생명력, 공격속도 중 하나\n- {@YELLOW}3번{@DEFAULT} : 방어력\n- {@YELLOW}4번{@DEFAULT} : 공격력, 방어력, 생명력, 치명확률, 치명피해 중 하나\n- {@YELLOW}5번{@DEFAULT} : 생명력\n- {@YELLOW}6번{@DEFAULT} : 공격력, 방어력, 생명력, 효과적중, 효과저항 중 하나\n\n공격력,방어력,생명력 증가 옵션은 1,3,5번 룬은 수치 증가, 2,4,6번 룬은 비율(%)증가가 부여되며 비율(%)증가의 옵션이 수치 증가보다 효율이 좋습니다.']='Bu Runesning standart xususiyatlari va har bir Rune ularning soniga ko\'ra turli xil variantlarga ega. \n\n- {@YELLOW}№ 1{@DEFAULT}: ATK \n- {@YELLOW}№ 2{@DEFAULT}: ATK, DEF, HP, ATK tezligidan biri \n- {@YELLOW}№ 3{@DEFAULT}: DEF \n- {@YELLOW}№ 4{@DEFAULT}: ATK, DEF, HP, kritik tezlik, muhim DMGdan biri \n- {@YELLOW}№5{@DEFAULT }: HP \n- {@YELLOW}№ 6{@DEFAULT}: ATK, DEF, HP, ta\'sir aniqligi, ta\'sirga chidamlilikdan biri \n\nATK, DEF va HP oshirish parametrlari uchun, № 1, 3, 5 Runes qiymatni o\'zi oshiradi, № 2, 4, 6 Runes esa ularni foizga (%) oshiradi. Ikkinchisi avvalgisiga qaraganda samaraliroq.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑으로, 탑을 정복한 자에게는 많은 보물이 주어진다고 전해집니다.\n고대의 탑과 관련해서는 다음의 내용을 잊지 마세요\n\n- 고대의 탑은 {@YELLOW}1층부터 차례대로{@DEFAULT} 올라갈 수 있으며, 매 층 클리어 시 다양한 보상을 제공합니다.\n- 이미 클리어한 층도 다시 플레이할 수 있으나, {@YELLOW}매우 소량의 보상{@DEFAULT}만 제공됩니다.\n- 같은 층을 반복해서 실패할 경우 많은 공격을 받은 {@YELLOW}고대의 탑의 몬스터들이 약해진다{@DEFAULT}고 합니다.\n- 고대의 탑 클리어 시 {@YELLOW}클리어 시간, 드래곤의 사망 여부, 약화 효과 단계{@DEFAULT}에 따라 클리어 점수를 받게 됩니다.\n- 고대의 탑 점수로 고대의 탑을 즐긴 다른 테이머 분들과의 순위가 책정되며, 이곳에서만 얻을 수 있는 희귀한 재화인 {@YELLOW}고대주화{@DEFAULT}를 포함한 많은 보상을 얻을 수 있습니다.\n  고대주화는 상점에서 {@YELLOW}매우 희귀한 드래곤의 인연 포인트{@DEFAULT}와 교환할 수 있습니다.\n- 고대의 탑의 점수 및 클리어 정보는 2주마다 한 번씩 초기화됩니다.']='Tamers uzoq vaqt oldin o\'zlarini sinab ko\'rish uchun ko\'tarilgan afsonaviy minora. Minorani zabt etganlarga katta xazina beriladi, deyishadi.\nQuyida Qadimiy minora haqidagi tarkibni unutmang. \n\n- Qadimgi minoraga {@YELLOW} 1F{@DEFAULT} dan koʻtarilish mumkin va har bir darajani tozalash uchun turli mukofotlar beriladi. \n- Tozalangan darajalarni yana oʻynashingiz mumkin, lekin {@YELLOW} juda kam mukofot{@DEFAULT} beriladi. \n- Aytishlaricha, agar siz bir xil darajada bir necha marta muvaffaqiyatsizlikka uchrasangiz, Qadimgi minoradagi {@YELLOW} yirtqich hayvonlar zaiflashadi{@DEFAULT}. \n- Qadimgi minorani tozalashda siz {@YELLOW} aniq vaqtga, ajdaholarning omon qolishiga va zaif effekt darajasiga{@DEFAULT} qarab aniq ball olasiz. \n- Qadimgi minora reytingingiz asosida siz Ancient Tower oʻyinini oʻynagan boshqa Tamerlar qatoriga kirgansiz. Siz koʻplab mukofotlarga ega boʻlishingiz mumkin, jumladan , {@YELLOW} Qadimgi tangalar{@DEFAULT} nomli noyob oʻyin valyutasi. \nQadimgi tangalarni doʻkonda {@YELLOW} juda kam uchraydigan ajdahoning aloqa nuqtalariga{@DEFAULT} almashtirish mumkin. \n- Ancient Tower Score va Clear Info har 2 haftada yangilanadi.',
