{@green} Reflect{@DEFAULT}: Dushmandan faqat 80% zarar oling va 20% hujumchiga qaytaring. \n- {@green} Immunitet{@DEFAULT}: Barcha zararli ta\'sirlarga qarshi immunitet. Hozirgi zararli ta\'sirlar olib tashlanmaydi. \n- {@green} HP absorbsiyasi{@DEFAULT}: HP sifatida dushmanga yetkazilgan zararning 10 foizini tiklang.',
