['다른 테이머님들과 드래곤의 강함을 겨룰 수 있는 경쟁 모드입니다.\n\n- 콜로세움을 사용하기 위해서는 콜로세움 입장권이 필요하며, 콜로세움 전투를 통해 명예 포인트를 획득하여 상점에서 각종 상품과 교환할 수 있습니다.\n- 콜로세움은 매 주말 초기화되며, {@YELLOW}최종 순위에 따라 다양한 보상{@DEFAULT}을 얻게 됩니다.\n- 콜로세움 전투에서 일정 시간이 경과될 때 마다 참여한 드래곤들의 {@YELLOW}공격시 피해량이 단계적으로 증가{@DEFAULT}되며 {@YELLOW}회복량이 단계적으로 감소{@DEFAULT}됩니다.\n\n콜로세움의 클랜 순위는 성적 상위 20명의 점수만 반영됩니다.(보상은 클랜원 전체가 획득)']='Bu sizning ajdaholaringiz bilan boshqa Tamerlar bilan raqobatlasha oladigan rejim. \n\n- Kolizey kirish uchun sizga Kolizey kirish chiptasi kerak bo\'ladi va do\'konda turli buyumlarga almashtirish uchun Honor Points olishingiz mumkin. \n- Kolizey har hafta oxiri asliga qaytariladi va siz oxirgi reytingingizga koʻra {@YELLOW} turli mukofotlarga ega boʻlishingiz mumkin{@DEFAULT}. \n- Kolizey janglarida qatnashuvchi ajdarlarning hujum paytidagi {@YELLOW} zarari vaqt oʻtishi bilan asta-sekin ortadi{@DEFAULT} va {@YELLOW} tiklanish darajasi asta-sekin kamayadi{@DEFAULT}. \n\nKolizeyning klan reytingi uchun faqat eng yaxshi 20 ta ball hisobga olinadi. (Barcha klan a\'zolari mukofot oladi.)',
