['드래곤 빌리지M의 무대가 되는 유타칸 세계에서 벌어지는 {@YELLOW}이야기{@DEFAULT}를 따라가며\n테이머와 드래곤을 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.']='Dragon Village M dunyosi boʻlgan Yutakan {@YELLOW} hikoyasini{@DEFAULT} Kuzatish ,\nva oʻzlashtiruvchilar va ajdaholaringizni { {@YELLOW}} darajaga koʻtaring{@DEFAULT}.',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Sarguzashtingiz davomida uchrashgan ajdaholarning xotiralaridan { {@YELLOW} Aloqa ballarini{@DEFAULT} oling. \n\nAloqa ballari bilan siz do\'stlaringizni Hatchery (Summon) ga chaqirishingiz mumkin. \nShuningdek, siz doʻstlaringiz topgan munosabatlar zindonlariga kirishingiz mumkin.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Yutakan boshqa hududlarini {@YELLOW} o‘rganishga{@DEFAULT}, {@YELLOW} darajaga{@DEFAULT} ajdarlaringizni yuboring. \n\nTadqiqotga yuborish uchun sizga kamida beshta ajdar kerak. Qaytib kelgach, ular topilgan Runes va Ametistlarni olib kelishadi.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Kuniga bir marta mahsulotlarni {@YELLOW} arzonroq narxda{@DEFAULT} xarid qilishingiz mumkin. \n\nKengaytirilgan chaqiruv chiptalari, Oltin, Oltin kuchaytirgichlar va sarguzashtingiz davomida foydalanishingiz mumkin boʻlgan EXPni xarid qilish mumkin.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Yutakan sirli kuchini oʻzlashtirgandan soʻng tirik boʻlgan {@YELLOW} massiv daraxtlar{@DEFAULT} bor. \n\nUshbu daraxtlarni yengsangiz, turli xil {@YELLOW} mevalarni{@DEFAULT} olishingiz va ajdarlar bilan yaqinligingizni oshirishingiz mumkin. \n\nSiz kiritishingiz mumkin boʻlgan zindonning atributlari haftaning har bir kuni uchun oʻzgaradi.',
['태초의 드래곤의 힘이 담긴 진화의 보석과 자연의 정기를 지키고 있는 거대용들의 서식지입니다.\n\n거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Bu Evolyutsiya marvaridini va ajdarlarning kuchini o\'z ichiga olgan energiyani qo\'riqlaydigan massive ajdaholarning yashash joyidir. \n\nMassiv ajdarlarni magʻlub qilganingizda, siz {@YELLOW} Evolyutsiya marvaridiga va energiyaga{@DEFAULT} ega boʻlasiz, bu esa {@YELLOW} Ajdaho Evolyutsiya {@DEFAULT} boshlaydi.\nAjdaho evolyutsiyaga uchraganida, u tashqi koʻrinishini oʻzgartiradi va yangi ko\'nikmalar bilan yanada kuchliroq bo\'ladi. \n\nSiz kiritishingiz mumkin boʻlgan zindonning atributlari haftaning har bir kuni uchun oʻzgaradi.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n\n더 높은 층으로 올라갈 수록 더욱 강력한 드래곤들을 물리쳐야만 합니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Tamers uzoq vaqt oldin o\'zlarini sinab ko\'rish uchun ko\'tarilgan afsonaviy minora. \n\nKoʻtarilgan sari kuchliroq ajdarlar bilan jang qilasiz.\nHar bir qavatni boʻshatsangiz, turli mukofotlarga ega boʻlasiz va har bir qavat uchun toʻplagan ballaringizga qarab {@YELLOW} oʻringa ega boʻlasiz{@DEFAULT}. \n\nAncient Tower-ning har bir fasli 2 hafta davom etadi va siz reytingingiz asosida {@YELLOW} Qadimgi tangalarni{@DEFAULT} olishingiz mumkin.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='Narvi tadqiqoti uchun qadimiy tangalarni yigʻish uchun doʻkon ochdi.\nQadimiy minoradan yigʻilgan qadimiy tangalarni {@YELLOW} Ajdahoning aloqa nuqtalari{@DEFAULT} va boshqa narsalarga almashtirish mumkin. \n\nU kayfiyatiga qarab sotiladigan narsalarni vaqti-vaqti bilan almashtirib turadi.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.\n\n콜로세움에서 획득한 명예와 용맹 훈장은 상점에서 특별한 상품들과 교환 할 수 있습니다.']='Kolizey - bu boshqa tamponchilar bilan raqobatlasha oladigan jang maydoni. \n\nJangga qoʻshilganingizda {@YELLOW} Honor{@DEFAULT} olishingiz mumkin va natijaga koʻra reytingga ega boʻlasiz.\nHar bir mavsum dam olish kuni tugaydi va sizga {@YELLOW} Jasorat medali{@ DEFAULT} va sizning reytingingizga ko\'ra Olmoslar . \n\nKolizey toʻplagan “Shon-sharaf va jasorat” medalini doʻkonda maxsus buyumlarga almashtirish mumkin.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Bu qadimiy xarobalarda topilgan sirli kapsulalarni chizishingiz mumkin bo\'lgan joy. \n\nKapsulalarni chizish uchun sizga Yutakan dunyosidagi temirchilar tomonidan qayta ishlangan {@YELLOW} kapsula tangalari{@DEFAULT} kerak.\nKapsulalar terbiyechilar orasida mashhur, chunki ularda {@YELLOW} Afsonaviy ajdarlar{@DEFAULT kabi noyob buyumlar mavjud. }.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Bu zindon boʻlib, u yerda juda koʻp tamerlar va ajdaholar “Kabus mujassamlanishi” hujumiga uchragan.\nTamerlar umidsiz janglar izlari bilan birga butun yerga tarqalib ketgan runlar tomonidan vasvasaga solinadi. \n\nKabusning mujassamlanishini yengsangiz, siz Runes olasiz. {@YELLOW} Qanchalik uzoqlashsangiz, runlarning bahosi shunchalik yuqori bo‘ladi{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='O\'rmonda tamerlar va ajdarlar dam olishlari va bir-birlari bilan muloqot qilishlari mumkin. \n\nOʻrmoningizning {@YELLOW} darajasi{@DEFAULT} qanchalik baland boʻlsa, shuncha koʻp ajdaholar qolishi mumkin.\nShuningdek, obʼyektlar darajasini oshirishingiz mumkin, natijada koʻproq mukofotlar olinadi.',
['유타칸의 테이머들은 혼자의 힘만으로는 물리칠 수 없는 어둠의 존재에 대항할 방법이 필요했습니다.\n클랜은 이러한 뜻이 맞는 테이머들이 연합할 수 있는 단체입니다.\n\n클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Yutakan dunyosida tamponlar birlashish yo\'lini topishlari va yolg\'iz kurashgan taqdirda mag\'lub bo\'lmaydigan qora kuchlarga qarshi kurashishlari kerak edi.\nKlan bu maqsadda birlashgan tamerlar guruhidir. \n\nKlanga mansub boʻlsangiz, siz klan darajasiga qarab {@YELLOW} klan buffiga ega boʻlasiz{@DEFAULT}.\nKlan faoliyatiga koʻra, tamerlar {@YELLOW} klan tangalariga ega boʻladilar{@DEFAULT } do\'konda maxsus buyumlarga almashtirilishi mumkin.',
['테이머 연합에서는 테이머들의 실력 향상을 위해 그림자의 신전을 만들었습니다.\n\n이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Tamer alyansi tamponlarning qobiliyatlari va mahoratini oshirish uchun Soyalar Ma\'bad qurdi. \n\nMa\'badda butun dunyo bo\'ylab eng yaxshi tamerlar va ajdarlar bilan bir xil statistikaga ega bo\'lgan soyalar mavjud.\nBiroq soyalar bilan kurashish uchun siz Kolizey o\'z kuchingizni isbotlashingiz kerak. \n\nSoyalar Ma\'bad siz {@YELLOW} Rune sehrli toshini{@DEFAULT} olishingiz mumkin.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Bu sirli minorani faqat Qadimgi minorada o\'z chegarasidan oshib ketganlar topishlari mumkin. \n\nSinovlar minorasida kuchli elementar energiyasi tufayli faqat minora bilan bir xil atributga ega {@YELLOW} ta ajdaho{@DEFAULT} jangga qoʻshilishi mumkin.\nHar bir atributning minorasini tozalaganingizda, siz quyidagilarni olishingiz mumkin. cheklangan ajdahoga aylangan {@YELLOW} mutlaq afsonaviy Tuxum{@DEFAULT}.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n\n테이머 협회는 악명이 자자한 악몽던전에서도 살아 돌아온 뛰어난 테이머만의 입장을 허락하고 있습니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='Zulmat izdoshi tomonidan tiriltirilgan kuchli mexanik ajdaho Ex Machina bu zindonda yashaydi. \n\nTamer alyansi faqat mashhur Nightmare Dungeondan omon qolganlarga kirishga ruxsat beradi. \n{@YELLOW} Jangga 10 tagacha ajdaho qoʻshilishi mumkin {@DEFAULT} va Ex Machina-ni magʻlub etganingizda, maxsus mahoratga ega boʻlgan {@YELLOW} Qadimgi Runes{@DEFAULT} va\n{@YELLOW} ga ega boʻlishingiz mumkin. Amorru kitoblari{@DEFAULT}, ular mahorat darajasini oshirish uchun ishlatiladi.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.\n테이머는 원하는 종류의 룬을 얻기 위해 던전을 선택해 입장 할 수 있습니다.']='Bu zindon birinchi rune kuchiga ega bo\'lgan Rune Guardian tomonidan qo\'riqlanadi. \n\nRun Guardians Dungeonda {@YELLOW} Drag Skill-dan foydalanib boʻlmaydi{@DEFAULT}, chunki sehr oqimi beqaror.\n6 zindondan iborat boʻlib, siz {@YELLOW} maxsus turdagi Rune olishingiz mumkin. Har bir zindonda {@DEFAULT}.\nOʻzingizga kerakli rune turini olish uchun zindon tanlashingiz mumkin.',
['오랜세월 잠들어 있던 죄악의 화신이 어둠의 세력에 의해 되살아났습니다.\n클랜원들은 힘을 합쳐 죄악의 화신을 막아내야 합니다.\n\n클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='Gunohlarning mujassamlanishi uzoq uyqudan so\'ng qorong\'u kuch tomonidan tirildi.\nEndi bu yovuz kuchga qarshi kurashish uchun klan a\'zolari birlashishi kerak. \n\nKlan zindonida siz {@YELLOW} 10 ta ajdar{@DEFAULT} bilan jang qilasiz va boshqa aʼzo boʻlsa, zindonga kira olmaysiz.\nBossning HP darajasi barcha klan aʼzolari uchun bir xil boʻlib qoladi. Agar siz xo\'jayinni mag\'lub qilsangiz, siz kuchliroq boshliq bilan kurashishingiz mumkin. \n\nZindonning har bir fasli bir hafta davom etadi va {@YELLOW} siz boshliqga yetkazilgan zararga qarab mukofot olishingiz mumkin.{@DEFAULT}',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Sarguzashtingiz davomida uchrashgan ajdaholar xotirasidan {@YELLOW} munosabat ochkosini{@DEFAULT} yutib oling.\nAloqa ballari bilan doʻstlaringizni Hatchery (Summon)ga chaqirishingiz mumkin. \nShuningdek, siz doʻstlaringiz topgan munosabatlar zindonlariga kirishingiz mumkin.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Ajdaholaringizni Yutakan boshqa hududlarini {@YELLOW} oʻrganishga{@DEFAULT} yuboring, {@YELLOW} darajaga koʻtaring{@DEFAULT}.\nTadqiqotga yuborish uchun kamida beshta ajdar kerak. Qaytib kelgach, ular topilgan Runes va Ametistlarni olib kelishadi.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Kuniga bir marta narsalarni {@YELLOW} arzonroq narxda xarid qilishingiz mumkin{@DEFAULT}.\nSarguzangiz davomida ishlatishingiz mumkin boʻlgan kengaytirilgan chaqiruv chiptalari, Oltin, Oltin kuchaytirgichlar va EXP xarid qilish mumkin.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Yutakan sirli kuchini oʻzlashtirgandan soʻng jonlangan {@YELLOW} massiv daraxtlar{@DEFAULT} bor.\nUshbu daraxtlarni yengsangiz, turli xil {@YELLOW} mevalarni{@DEFAULT} olishingiz va ajdarlar bilan yaqinligingizni oshirishingiz mumkin. .\nSiz kiritishingiz mumkin boʻlgan zindonning atributlari haftaning har bir kuni uchun oʻzgaradi.',
['거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Massive Dragons ustidan g‘alaba qozonganingizda, siz {@YELLOW} Evolyutsiya Gem va Energiyaga{@DEFAULT} ega bo‘lasiz, bu esa {@YELLOW} Ajdaho Evolyutsiya {@DEFAULT} ishga tushiradi.\nAjdaho evolyutsiyalashganda tashqi ko‘rinishini o‘zgartiradi va kuchliroq bo‘ladi. yangi ko\'nikmalar bilan.\nSiz kiritishingiz mumkin bo\'lgan zindonning atributlari haftaning har kuni uchun o\'zgaradi.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Tamers uzoq vaqt oldin o\'zlarini sinab ko\'rish uchun ko\'tarilgan afsonaviy minora. \nHar bir qavatni tozalaganingizda turli mukofotlarga ega boʻlasiz va har bir qavat uchun toʻplagan ballaringizga qarab {@YELLOW} oʻringa ega boʻlasiz{@DEFAULT}.\nAncient Towerning har bir mavsumi 2 hafta davom etadi va siz {@YELLOW} Qadimgi tangalar{@DEFAULT} reytingingiz asosida.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='Narvi tadqiqoti uchun qadimiy tangalarni yig‘ish uchun do‘kon ochdi.\nQadimiy minoradan yig‘ilgan qadimiy tangalarni {@YELLOW} Ajdahoning aloqa nuqtalari{@DEFAULT} va boshqa narsalarga almashtirish mumkin.\nU har safar sotiladigan narsalarni o‘zgartiradi. vaqti-vaqti bilan, uning kayfiyatiga qarab.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.']='Kolizey – bu jang maydoni bo‘lib, unda siz boshqa tamponchilar bilan raqobatlashasiz.\nJangga qo‘shilsangiz, {@YELLOW} Honor{@DEFAULT} olishingiz mumkin va natijaga ko‘ra reytingga ega bo‘lasiz.\nHar bir mavsum dam olish kunlari tugaydi va reytingingizga koʻra {@YELLOW} Jasorat medali{@DEFAULT} va Olmoslar ega boʻlasiz.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Bu qadimiy xarobalar orasidan topilgan sirli kapsulalarni chizishingiz mumkin boʻlgan joy.\nKapsulalarni chizish uchun Yutakan dunyosida temirchilar tomonidan qayta ishlangan {@YELLOW} kapsula tangalari{@DEFAULT} kerak boʻladi.\nKapsulalar terbiyechilar orasida mashhur. ularda {@YELLOW} Afsonaviy ajdarlar{@DEFAULT} kabi noyob buyumlar mavjud.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Bu zindon boʻlib, u yerda juda koʻp tamerlar va ajdaholar “Kabus mujassamlanishi” hujumiga uchragan.\nTamerlar butun yerga tarqalib ketgan runlar vasvasasiga tushib qolishadi, shuningdek, umidsiz janglar izlari.\nKabus mujassamini yengganingizda, siz Runesga ega boʻlasiz. . {@YELLOW} Qanchalik uzoqlashsangiz, runlarning bahosi shunchalik yuqori bo‘ladi{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='Oʻrmonda tamponlar va ajdarlar dam olishlari va bir-birlari bilan muloqot qilishlari mumkin.\nOʻrmoningizning darajasi {@YELLOW} qanchalik baland boʻlsa{@DEFAULT}, ajdarlar shunchalik koʻp qolishi mumkin.\nShuningdek, obʼyektlar darajasini ham oshirishingiz mumkin. ko\'proq mukofotlarga olib keladi.',
['클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Klanga mansub boʻlsangiz, siz klan darajasiga qarab {@YELLOW} klan buffiga ega boʻlasiz{@DEFAULT}.\nKlan harakatlariga koʻra, tamerlar {@YELLOW} klan tangalarini{@DEFAULT} oladi. do\'konda maxsus buyumlarga almashtirilishi mumkin.',
['이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Maʼbadda butun dunyo boʻylab eng yaxshi tamerlar va ajdaholar bilan bir xil koʻrsatkichlarga ega boʻlgan soyalar bor.\nBiroq soyalar bilan kurashish uchun siz Kolizey oʻz kuchingizni isbotlashingiz kerak .\nSoyalar Ma\'bad siz {@YELLOW} Rune sehrli tosh{@DEFAULT}.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Bu sirli minorani faqat Qadimgi minorada o‘z chegarasidan oshib ketganlar topishi mumkin.\nSinovlar minorasida faqat minora bilan bir xil atributga ega {@YELLOW} ta ajdaho{@DEFAULT} kuchli elementi tufayli jangga qo‘shilishi mumkin. energiya.\nHar bir atributning minorasini tozalaganingizda, cheklangan ajdahoga aylanadigan {@YELLOW} Absolute Legendary Tuxum{@DEFAULT} olishingiz mumkin.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='Zulmat izdoshi tomonidan tiriltirilgan kuchli mexanik ajdaho Ex Machina bu zindonda yashaydi. \n{@YELLOW} Jangga 10 tagacha ajdaho qoʻshilishi mumkin {@DEFAULT} va Ex Machina-ni magʻlub etganingizda, maxsus mahoratga ega boʻlgan {@YELLOW} Qadimgi Runes{@DEFAULT} va\n{@YELLOW} ga ega boʻlishingiz mumkin. Amorru kitoblari{@DEFAULT}, ular mahorat darajasini oshirish uchun ishlatiladi.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.']='Bu zindon birinchi rune kuchiga ega boʻlgan Rune Guardian tomonidan qoʻriqlanadi.\nRun Guardians Dungeonda sehr oqimi beqaror boʻlgani uchun {@YELLOW} Drag Skill ishlatilmaydi{@DEFAULT}.\nTublikat 6 zindondan, har bir zindonda {@YELLOW} oʻziga xos Rune turini{@DEFAULT} olishingiz mumkin.',
['클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='Klan zindonida siz {@YELLOW} 10 ta ajdar{@DEFAULT} bilan jang qilasiz va boshqa aʼzo boʻlsa, zindonga kira olmaysiz.\nBossning HP barcha klan aʼzolari uchun bir xil boʻlib qoladi. Bossni yengsangiz, kuchliroq bossga qarshi kurashishingiz mumkin.\nZindonning har bir mavsumi bir hafta davom etadi va {@YELLOW} bossga yetkazilgan zararga qarab mukofot olishingiz mumkin.{@DEFAULT}',
