['{@YELLOW}클랜전{@DEFAULT}은 클랜간의 경쟁 콘텐츠입니다.\n각 클랜원은 상대 클랜원을 공격해 전투를 진행하며, 전투에서 승리 시 승점을 획득합니다.\n경기가 종료 될 때, 더 많은 승점을 보유한 클랜이 경기에서 승리하게 됩니다.']='{@YELLOW} Klan urushi{@DEFAULT} – bu klan musobaqasi rejimi.\nHar bir klan aʼzosi raqib klan aʼzolari bilan jang qiladi va gʻalaba qozonganida ochko oladi. \nO\'yin oxirida ko\'proq ochko to\'plagan klan o\'yinda g\'alaba qozonadi.',
