['클랜전은 2주간 진행되며 1주차 {@YELLOW}조별리그{@DEFAULT}와 2주차 {@YELLOW}토너먼트{@DEFAULT}로 구성되어 있습니다.']='Klan urushi 2 hafta davom etadi, birinchi haftada {@YELLOW} Guruh bosqichi{@DEFAULT} va keyingi haftada {@YELLOW} Turnir{@DEFAULT}.',
['참가 조건을 만족하는 클랜은 별도의 참가 신청 없이 {@YELLOW}매 시즌 자동으로{@DEFAULT} 클랜전에 참가 됩니다.\n클랜전에 참가하기 위해서는 아래의 조건 중 하나를 만족해야 합니다.\n1. 이전 시즌 토너먼트 출전 기록이 있는 클랜\n2. 이전 시즌 콜로세움 랭킹 기록이 있으며 순위를 만족하는 클랜']='Kirish mezonlariga {@YELLOW} avtomatik ravishda{@DEFAULT} javob beradigan klanlar har mavsumda Klan urushiga qoʻshiladi. \nKlanlar urushiga qoʻshilish uchun klan quyidagilarni bajarishi kerak \n1. oldingi mavsumda turnir o\'ynagan yoki \n2. oldingi mavsumda Kolizey reytingi talabiga javob bering.',
['조별리그에서는 같은 조에 배정된 클랜들과 하루에 한 번 {@YELLOW}매치{@DEFAULT}를 진행합니다.\n모든 매치가 종료 된 후, 매치에서 승리한 횟수를 통해 조별 리그의 순위가 매겨집니다.\n각 조의 {@YELLOW}1,2위 클랜{@DEFAULT}은 토너먼트에 진출합니다.\n토너먼트에 진출하지 못한 클랜은 이후 일정에 참가할 수 없습니다.']='Guruh bosqichida klanlar bir guruhdagi boshqa klanlar bilan kuniga bir marta {@YELLOW} tenglashtiriladi{@DEFAULT}.\nGuruh bosqichi oʻyinlari yakunlangach, klanlar gʻalabalar soniga qarab tartiblanadi. \nHar bir guruhda 1 va 2-o\'rinni egallagan {@YELLOW} {@DEFAULT} klanlari Turnirga yo\'l oladi.\nSaralashdan o\'tmagan klanlar Turnir o\'yinlarini o\'ynay olmaydi.',
['토너먼트는 하루에 한 번, 같은 조에 배치된 클랜과 매치를 진행합니다.\n매치에서 승리한 클랜은 다음 라운드에 진출합니다.\n패배한 클랜은 이후 일정에 참가할 수 없습니다. ']='Turnir o\'yinlari kuniga bir marta bitta guruhdagi boshqa klanlarga qarshi o\'tkaziladi.\nUchrashuvda g\'alaba qozongan klanlar keyingi bosqichga o\'tadi.\nUchrashuvda yutqazgan klan boshqa o\'yin o\'tkazmaydi.',
['게임 시작 시 최소 10명에서 최대 20명의 클랜원이 클랜원 리스트에 등록됩니다.\n클랜원 리스트는 {@YELLOW}클랜원이 더 적은 클랜{@DEFAULT}의 인원수에 맞추어 등록됩니다.\n최소 인원을 확보하지 못한 클랜은, 부족한 인원수 만큼 상대 클랜에게 {@YELLOW}부전승 승점{@DEFAULT}을 제공합니다.']='O\'yin boshlanganda, klan a\'zolari ro\'yxatiga 10 dan 20 gacha klan a\'zolari qo\'shiladi. \nRoʻyxat {@YELLOW} kamroq aʼzosi boʻlgan klanga mos keladigan aʼzolar soni asosida tuzilgan{@DEFAULT}. \nEtarli a\'zosi bo\'lmagan klan, boshqa klanga nisbatan etishmayotgan har bir a\'zo uchun {@YELLOW} ma\'lum ballni{@DEFAULT} yo\'qotadi.',
['게임이 시작되면 {@YELLOW}각 클랜원은 한 번의 공격 기회{@DEFAULT}를 가지게 됩니다.\n상대 클랜원을 공격하면 {@YELLOW}세트가 시작되며, 한 세트는 최대 3번의 {@YELLOW}게임{@DEFAULT}으로 진행됩니다.\n세트에서 먼저 2번의 게임을 승리하면 {@YELLOW}승점 1점{@DEFAULT}을 획득합니다.\n세트 시작 후, {@YELLOW}제한 시간{@DEFAULT}안에 승패가 결정되지 않으면 공격자의 패배로 처리됩니다.']='O\'yin boshlanganda, {@YELLOW} har bir klan a\'zosi bittadan hujum qilish imkoniyatiga ega bo\'ladi{@DEFAULT}.\nRaqib klan a\'zosiga hujum qilganingizda, {@YELLOW} to\'plam boshlanadi, 3 tagacha {@YELLOW} Har bir toʻplam uchun @DEFAULT}. \nQaysi klan ikki o‘yinda g‘alaba qozonsa , {@YELLOW} 1 ball{@DEFAULT} oladi. \nAgar {@YELLOW} ma\'lum vaqtdan{@DEFAULT} keyin g\'olib aniqlanmasa, hujum qilayotgan klan o\'yinni yutqazadi.',
['게임이 종료 된 후, 양 클랜 중 승점의 합이 더 높은 클랜이 승리하게 됩니다.\n만일 두 클랜의 {@YELLOW}승점이 같다면{@DEFAULT} 아래의 규칙을 순서대로 적용해 승리 클랜을 결정합니다.\n1. 세트에 참여한 클랜원 수가 더 많은 클랜의 승리\n2. 클랜원의 게임 승리 수가 더 높은 클랜의 승리\n3. 클랜 레벨(경험치)이 더 높은 클랜의 승리\n4. 클랜 생성일이 더 빠른 클랜이 승리']='O\'yin tugagach, qaysi klan ko\'proq ochkoga ega bo\'lsa, o\'yinda g\'alaba qozonadi. \nAgar ikkala klanning ham {@YELLOW} bir xil ochkolari{@DEFAULT} boʻlsa, gʻolibni aniqlash uchun quyidagi qoidalar qoʻllaniladi. \n1. To\'plamga ko\'proq a\'zo qo\'shilgan klan o\'yinda g\'alaba qozonadi. \n2. Klan a\'zolari ko\'proq g\'alaba qozongan klan o\'yinda g\'alaba qozonadi. \n3. Yuqori darajadagi (EXP) bo\'lgan klan o\'yinda g\'alaba qozonadi. \n4. Oldin yaratilgan klan o\'yinda g\'alaba qozonadi.',
['클랜원 리스트에 포함된 유저가 매치 진행중 클랜을 탈퇴할 경우, 해당 매치까지는 탈퇴한 유저의 정보가 리스트에 그대로 적용됩니다.\n매치 시작 이후 클랜에 가입한 유저는 해당 매치에 참여할 수 없습니다.\n클랜전이 진행되는 동안 클랜이 해체될 경우, 이후 예정되었던 모든 매치는 부전패 처리됩니다.']='Agar a\'zo klanni tark etsa, uning foydalanuvchi ma\'lumotlari o\'yin ro\'yxatida qoladi. \nAgar oʻyinchi oʻyin davomida klanga qoʻshilsa, u oʻyinga qoʻshila olmaydi. \nAgar klan urushi paytida tarqatib yuborilsa, klan kelgusi oʻyinlarda magʻlub boʻladi.',
['조별리그에 참여한 클랜 중 {@YELLOW}상위 32개의 클랜{@DEFAULT}은 각각 다른 조에 배치됩니다.\n이후 나머지 클랜들이 무작위로 조에 배치됩니다.\n토너먼트에 진출한 클랜 중 {@YELLOW}조별리그 1위{@DEFAULT}를 달성했던 클랜은 각각 다른 조에 배치됩니다.\n이후 나머지 클랜들이 무작위로 조에 배치됩니다.']='{@YELLOW} Guruh bosqichidagi eng yaxshi 32 ta klan{@DEFAULT} turli guruhlarga joylashtiriladi. \nQolgan klanlar tasodifiy tarzda joylashtiriladi. \n{@YELLOW} Har bir guruh yetakchisi{@DEFAULT} Turnirga chiqishda turli guruhlarga joylashtiriladi. \nKeyin, qolgan klanlar tasodifiy tarzda joylashtiriladi.',
