['모든 증오를 담아 죽음의 브레스로 적에게 피해를 줍니다.\n치명 확률에 따라 위력이 크게 증가합니다.\n보스 공격 시 타겟이 적을수록 피해량이 증가합니다.']='U barcha nafratni o\'zida jamlagan o\'lim nafasi bilan dushmanlarga zarar etkazadi.\nUning kuchi kritik imkoniyatga qarab sezilarli darajada oshadi.\nBossga hujum qilganda, nishon dushmanga aylanganda zarar ortadi.',
['분노에 가득찬 다크닉스는 방어를 포기하고 공격만을 수행합니다. 모든 드래곤의 치명타 확률이 300% 증가합니다.']='Darknix g\'azabdan to\'lqinlanib, himoyadan voz kechadi va faqat hujumga e\'tibor qaratadi. Barcha ajdaholarning kritik zarba ehtimoli 300% ga oshadi.',
