['아모르의 첫 번째 자손으로서 태초의 힘을 지닌 어둠의 수호자였다. 그러나 가장 소중한 존재를 잃고 타락했다. 세상을 파괴하고 고대신룡과 싸워 승리 직전에 아모르의 창을 맞고 쓰러졌다. 영원한 고통 속에서 살아온 이 드래곤은 모든 것의 파멸만을 원한다.']='U Amorruning birinchi avlodi va boshlang\'ich kuchiga ega bo\'lgan zulmatning qo\'riqchisi edi. Biroq, u eng qadrli mavjudotni yo\'qotdi va buzuqlikka tushdi. U dunyoni vayron qildi va Xudo ajdaho qarshi kurashdi, lekin g\'alabaga erishishdan oldin Amorruning nayzasi bilan urib tushirildi. Abadiy iztirobda yashagan bu ajdaho faqat hamma narsani yo\'q qilishni xohlaydi.',
['이 드래곤의 분노는 빛을 향해 있습니다. 이 공격은 방어력, 수호, 무적, 부활등의 모든 방어 수단을 무시하며 빛 속성 대상에게는 20배의 피해를 입힙니다.전투 시작 시에 1회만 발동합니다.']='Bu ajdahoning g\'azabi nurga qaratilgan. Ushbu hujum mudofaa, himoya, yengilmaslik, tirilish va boshqalar kabi barcha mudofaa choralarini e\'tiborsiz qoldiradi va engil atributli nishonlarga 20 baravar ko\'proq zarar etkazadi. U faqat jang boshida bir marta faollashadi.',
['이벤트 기간 동안 파멸의 어둠 소환에 사용할 수 있는 소환권, 낮은 확률이지만, 파멸의 다크닉스을 소환할 수 있다고 한다.']='Voqea paytida, vayronagarchilik zulmatini chaqirishda foydalanish uchun chaqiruv chiptasi mavjud. Bu past ehtimollik bo\'lsa-da, Darknix of Ruinni chaqirish mumkinligi aytiladi.',
['이벤트 기간 동안 파멸의 어둠 이벤트 상점에서 사용할 수 있는 재화, 이벤트 스테이지나 이벤트 업적을 통해 획득할 수 있다.']='Voqealar paytida siz vayronagarchiliklar do\'konining zulmatida ishlatilishi mumkin bo\'lgan valyutani, shuningdek, voqea bosqichlari va yutuqlarini olishingiz mumkin.',
['일정 시간마다 무작위 적 하나를 공격하여 대상에게 각각 {1}% 확률로 {2}초간 공격력 감소, 방어력 감소, 공격속도 감소, 지속피해를 부여합니다.']='Har bir ma\'lum vaqt oralig\'ida bitta dushmanga tasodifiy hujum qiling va hujumni {2} soniya kamaytirish, mudofaani pasaytirish, hujum tezligini pasaytirish va nishonga vaqt o\'tishi bilan zarar etkazish uchun {1} % imkoniyatga ega bo\'ling.',
['일정 시간마다 무작위 적을 공격합니다.\n매 타격마다 공격력 감소 효과를 부여합니다.\n보스 공격 시 타겟이 적을수록 피해량이 증가합니다.']='Vaqti-vaqti bilan tasodifiy dushmanlarga hujum qiling.\nHar bir zarbada zararni kamaytirish effektini bering.\nBoss hujumi paytida dushmanlarga hujum qilganda zarar ortadi.',
['일정 횟수의 일반 공격 시마다 자신의 목적을 상기시킵니다. 목적을 이루기 전 까지 발악하여 자신의 생명력을 회복합니다. 보유하고 있는 공격력 감소를 제외한 중첩 가능한 해로운 효과(방어력 감소, 공격 속도 감소, 지속 피해)의 중첩 개수 1개당 회복량이 4배로 증가합니다.']='Har safar ma\'lum miqdordagi oddiy hujumlarni amalga oshirganingizda, siz o\'zingizning maqsadingizni eslatasiz. Maqsadingizga erishmaguningizcha, unga qarshi turish orqali sog\'lig\'ingizni tiklaysiz. Hujum kuchini kamaytirish (mudofaani kamaytirish, hujum tezligini pasaytirish, davom etayotgan zarar) bundan mustasno, to\'planishi mumkin bo\'lgan har bir zararli ta\'sir to\'plami uchun tiklanish miqdori 4 baravar oshiriladi.',
['일정시간마다 가장 공격력이 높은 대상에게 10회에 걸쳐 튕기는 구체가 모든 방어 수단을 무시한 피해를 가합니다. 대상의 공격력이 낮을수록 피해량이 상승하며, 만약 대상의 공격력이 25000이상일 경우 피해가 무효화 됩니다.']='Har bir ma\'lum vaqt oralig\'ida, sakrab turgan shar barcha himoyani e\'tiborsiz qoldirib, 10 zarbadan yuqori hujum kuchi bilan nishonga zarar etkazadi. Zarar miqdori nishonning hujum kuchi kamayishi bilan ortadi va agar nishonning hujum kuchi 25 000 yoki undan yuqori bo\'lsa, zarar bekor qilinadi.',
['자신의 생명력이 0이 되면 40초간 좀비 상태가 되고, 치명 확률이 비약적으로 증가합니다.\n이 때, 스킬 쿨타임이 초기화되며 마나 2를 회복합니다. \n지속 시간이 끝난 뒤 사망합니다.']='Agar sizning hayotiyligingiz 0 ga yetsa, siz 40 soniya davomida zombi holatiga o\'tasiz va sizning kritik imkoniyatingiz keskin ortadi.\nBu vaqt ichida mahoratingizning sovish vaqti qayta tiklanadi va siz 2 manani tiklaysiz.\nDavomlik muddati tugagandan so\'ng, siz o\'lish.',
