['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.']='Ajdahoni ro\'yxatdan o\'tkazganingizdan so\'ng, baraka olish uchun baraka chiptasidan foydalanishingiz mumkin. \n\nBlessingning 5 turi bor va agar keraksiz variant paydo boʻlsa, siz olmosni isteʼmol qilib, opsiyani {@YELLOW} qayta oʻrnatishingiz mumkin{@DEFAULT}. \n- Initsializatsiyada opsiyada ishlatilgan barcha marhamat chiptasi qaytariladi. \n\nBaraka stackable va barcha ajdaholar va tarkiblarga tegishli.',
['전설 드래곤은 {@YELLOW}축복 티켓{@DEFAULT} 3개.\n신화 드래곤은 스킬 강화 단계에 따라 {@YELLOW}축복 티켓{@DEFAULT}이 지급 됩니다. (최대 15개 까지 획득 가능합니다.)\n\n신화 드래곤을 등록후 , 스킬 레벨업을 한뒤에 축복 시스템에 재 등록시 강화한 스킬 레벨 1당 축복 티켓 1개가 추가 지급됩니다.']='Afsonaviy Ajdaho 3 ta {@YELLOW} marhamat chiptasi bor{@DEFAULT}.\nMahoratni oshirish darajasiga qarab, Mythic Dragon {@YELLOW} marhamat chiptasini oladi{@DEFAULT}.(Siz ko‘pi bilan 15 ta elementga ega bo‘lishingiz mumkin. ) \n\nAfsonaviy Ajdaho roʻyxatdan oʻtkazganingizdan soʻng, mahoratingizni oshirib, marhamat tizimida qayta roʻyxatdan oʻtganingizdan soʻng, mahorat oshirishning har bir darajasi uchun qoʻshimcha marhamat chiptasiga ega boʻlasiz.',
['축복 티켓을 얻기 위해서는 {@YELLOW}육성이 완료된{@DEFAULT} 전설, 신화 드래곤을 등록해야 합니다.\n\n- 전설 드래곤 : 레벨 / 친밀도 / 강화 / 특성 / 진화 / 스킬\n- 신화 드래곤 : 레벨 / 친밀도 / 진화\n\n드래곤을 등록하여도 모든 콘텐츠에서 사용 가능합니다.\n동일한 드래곤을 여러마리 육성하여 등록하여도 , 한마리만 등록 가능합니다.']='Baraka chiptasini olish uchun {@YELLOW} toʻliq parvarishlashni{@DEFAULT} yakunlagan ajdahoni roʻyxatdan oʻtkazishingiz kerak. \n\n- Afsonaviy Ajdaho : daraja / yaqinlik / oshirish / mahorat / rivojlanish / mahorat \n- afsonaviy Ajdaho : daraja / yaqinlik / evolyutsiya \n\nAjdahoni roʻyxatdan oʻtkazgan boʻlsangiz ham, undan barcha tarkiblarda foydalanish mumkin boʻladi. \nAgar siz bir nechta ajdarlarni ro\'yxatdan o\'tkazsangiz ham, faqat bittasini ro\'yxatdan o\'tkazishingiz mumkin.',
['진정한 테이머가 되기 위한 길입니다.\n최대한 많은 드래곤을 육성 시켜 축복 시스템에 등록시키고, 획득한 {@YELLOW}축복 티켓{@DEFAULT}을 사용하여 {@YELLOW}축복 효과{@DEFAULT}를 받아보세요.']='Bu haqiqiy tamer bo\'lish yo\'li.\nIloji boricha ko\'proq ajdahoni tarbiyalang, ularni marhamat tizimida ro\'yxatdan o\'tkazing va {@YELLOW} marhamat effektlarini{@DEFAULT} olish uchun olingan { {@YELLOW}} marhamat chiptalaridan{@DEFAULT} foydalaning. .',
['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.\n\n특화 옵션 15단계와 기본 옵션의 10단계의 확률은 동일하며 , 특화 옵션일수록 더 높은 수치의 옵션을 획득할 확률이 높습니다.']='Ajdahoni ro\'yxatdan o\'tkazganingizdan so\'ng, baraka olish uchun baraka chiptasidan foydalanishingiz mumkin. \n\nBlessingning 5 turi bor va agar keraksiz variant paydo boʻlsa, siz olmosni isteʼmol qilib, opsiyani {@YELLOW} qayta oʻrnatishingiz mumkin{@DEFAULT}. \n- Initsializatsiyada opsiyada ishlatilgan barcha marhamat chiptasi qaytariladi. \n\nBaraka stackable va barcha ajdaholar va tarkiblarga tegishli. \n\n15-darajadagi ixtisoslashtirilgan variantni va 10-darajadagi asosiy variantni olish ehtimoli bir xil, lekin ixtisoslashtirilgan variantlar uchun yuqoriroq qiymatga ega variantni olish ehtimoli yuqori.',
